final List<dynamic> styles = ['.container {\n  position: relative;\n  background: #1C306D;\n  border-radius: 50%;\n  width: 60px;\n  height: 60px;\n}\n\nimg {\n  position: absolute;\n  border-radius: 50%;\n  object-fit: cover;\n}\nimg.placeholder {\n  z-index: 1;\n  width: 32px;\n  height: 32px;\n  top: 13px;\n  left: 13px;\n}\nimg.actual {\n  z-index: 2;\n  width: 60px;\n  height: 60px;\n  opacity: 0;\n  transition: opacity 250ms ease;\n}\nimg.actual.loaded {\n  opacity: 1;\n}\n'];